import React from 'react';

const RegisterForm = () => {
  return (
    <div>
      <h2>Register</h2>
      <form>
        <label>Username: </label>
        <input type="text" />
        <br />
        <label>Password: </label>
        <input type="text" />
        <br />
        <label>Confirm Password: </label>
        <input type="text" />
        <br />
        <button>Register</button>
      </form>
    </div>
  );
};

export default RegisterForm;
